chatTemplates["chat-web-push-bell-mobile"] = "<div v-if=\"isAvailable && status !== 'default'\"><div class=\"chat-offers__push chat-offers__push_secondary\"v-if=\"status === 'granted'\"><div class=\"chat-offers__hint\">Уведомления включены</div><div class=\"chat-offers__manage\"><div class=\"chat-offers__manage-list\"><div class=\"chat-offers__manage-item chat-offers__manage-item_specific\"><div class=\"chat-offers__manage-trigger chat-offers__manage-trigger_bell-secondary\"></div></div></div></div></div><div class=\"chat-offers__push chat-offers__push_secondary\"v-if=\"status === 'denied'\"><div class=\"chat-offers__hint\">Уведомления выключены</div><div class=\"chat-offers__manage\"><div class=\"chat-offers__manage-list\"><div class=\"chat-offers__manage-item chat-offers__manage-item_visible\":class=\"{ 'chat-offers__manage-item_opened': isPopoverOpened }\"><div class=\"chat-offers__manage-trigger chat-offers__manage-trigger_bell-alter\"@click=\"onDeniedTriggerClick\"></div><div class=\"chat-offers__manage-dropdown chat-offers__manage-dropdown_bottom-left\"@click=\"stopPropagation\"><div class=\"chat-offers__manage-arrow\"></div><div class=\"chat-offers__manage-overflow\"><div class=\"chat-offers__manage-description\">Для включения уведомлений снимите ограничения в&nbsp;настройках браузера</div></div></div></div></div></div></div><div class=\"chat-offers__push chat-offers__push_secondary\"v-if=\"status === 'closed'\"><div class=\"chat-offers__hint\">Уведомления выключены</div><div class=\"chat-offers__manage\"><div class=\"chat-offers__manage-list\"><div class=\"chat-offers__manage-item chat-offers__manage-item_visible\"><div class=\"chat-offers__manage-trigger chat-offers__manage-trigger_bell-alter\"@click=\"activate\"onclick=\"window.ga && ga('chats.send', 'event', 'Чаты', 'Колокольчик включить')\"></div></div></div></div></div></div>";

chatTemplates["chat-web-push-button"] = "<div class=\"notice-offers__item notice-offers__item_push\"v-if=\"isAvailable && status === 'default'\"><div class=\"notice-offers__close\"@click=\"close\"onclick=\"window.ga && ga('chats.send', 'event', 'Чаты', 'Отклонить включение уведомлений')\"></div><div class=\"notice-offers__subtitle\">Получайте сообщения мгновенно</div><div class=\"notice-offers__control\"><a class=\"notice-offers__button notice-offers__button_push notice-offers__button_visible\"@click=\"activate\"onclick=\"window.ga && ga('chats.send', 'event', 'Чаты', 'Включить уведомления')\">Включить уведомления</a></div></div>";
